	"Original"
	{
		"objective1"		"Uncleton's Pizzeria by Major Tiddys. Please leave feedback on the workshop page to improve this map."
		"<GameText>363056|dialogue_incorrect"		"Karen Angered! Reputation has lowered!"
		"<GameText>363058|dialogue_correct"		"Karen Subdued!"
		"<GameText>363083|karen_pissed_text"		"Karen stormed off pissed! Reputation dropped sharply!"
		"<GameText>368901|intro_text7"		"I wanna quit, but you gotta pay for college somehow...."
		"<GameText>368878|intro_text6"		"But he left us a message to never stop cooking."
		"<GameText>316233|perfect_roundText"		"All customers served! +Reputation"
		"<GameText>368856|intro_text5"		"Once the zombie outbreak began, Uncle Ton vanished without a trace."
		"<GameText>368837|intro_text4"		"So he hired us to do it for him at minimum wage."
		"<GameText>368818|intro_text3"		"His dream was to make pizza (and burgers too)"
		"<GameText>419359|boiler_alert_txt"		"Uhhh, is the boiler alright?"
		"<GameText>368799|intro_text2"		"It served burgers and stuff too, but thats beside the point."
		"<GameText>368791|intro_text1"		"15 years ago, Uncle Ton started his pizzeria."
		"<GameText>367747|finale_cutscene_text13"		"Use the machine to turn food into bullets."
		"<GameText>367727|finale_cutscene_text12"		"Theres a crate of weapons in the back of the store, use it to stop Uncle Tons invasion."
		"<GameText>367704|finale_cutscene_text11"		"We're gonna cook."
		"<GameText>367673|finale_cutscene_text10"		"But how????"
		"<GameText>367651|finale_cutscene_text9"		"Uncle Ton is gonna destroy the restaurant! We cant let him!"
		"<GameText>367621|finale_cutscene_text8"		"Dude, look outside"
		"<GameText>367596|finale_cutscene_text7"		"No... Uncle Ton, they got you too?"
		"<GameText>365645|finale_cutscene_text6"		"Lmao forgot about that"
		"<GameText>365592|finale_cutscene_text5"		"Uncle Ton, the owner of Uncletons Pizzeria, appears to be the culprit behind this destruction. Lets turn to chopper six for more."
		"<GameText>365566|finale_cutscene_text4"		"There is a giant zombie rampaging through out the city"
		"<GameText>365540|finale_cutscene_text3"		"We interrupt your TV static for this emergency boardcast!w"
		"<GameText>365512|finale_cutscene_text2"		"Wait a second.. whats on the TV?"
		"<GameText>365503|finale_cutscene_text1"		"Well, that should be the last of them. We can finally leave!!!"
		"<GameText>414718|bathroom_text"		"Nobody is in the bathroom!"
		"<GameText>375226|buy_purchaseFail_xlhamma"		"Not Enough Money to buy Rat-D-Stroyer! ($200)"
		"<GameText>375224|buy_purchaseSucess_xlhamma"		"Rat-D-Stroyer Purchased!"
		"<GameText>398224|practice_text"		"Feel free to practice during this round, but any extra food left at the end of the round will be destroyed."
		"<GameText>387935|driveby_warning"		"ITS A DRIVEBY, GET DOWN!!!!"
		"<GameText>214284|hud_round1"		"Round 1: First day on the job, make me proud!"
		"<GameText>214286|hud_round2"		"Round 2: Better start checking on that toilet"
		"<GameText>214288|hud_round3"		"Round 3: They prey at night they stalk at night.."
		"<GameText>214290|hud_round4"		"Round 4: I hope you guys are holding out, you got bills to pay!"
		"<GameText>214292|hud_round5"		"Round 5: Get ready for the lunch rush!"
		"<GameText>214294|hud_round6"		"Round 6: If you need more time to cook, buy a television. If the zombies are coming too fast, buy a shovel."
		"<GameText>214296|hud_round7"		"Round 7: Keeping a good reputation means more money. Provide excellent service!"
		"<GameText>214298|hud_round8"		"Round 8: This restaurant is going to shit real quick.."
		"<GameText>214300|hud_round9"		"Round 9: A teleporter would be pretty useful right about now"
		"<GameText>214302|hud_round11"		"Round 11: This restaurant is doing pretty good! Maybe the government WONT blow us up."
		"<GameText>214304|hud_round12"		"Round 12: I remember when this place was a good neighborhood.. actually I dont."
		"<GameText>214306|hud_round14"		"Round 14"
		"<GameText>214308|hud_round13"		"Round 13: How do the zombies even get into the toilet?"
		"<GameText>214310|hud_round15"		"Round 15"
		"<GameText>214342|hud_round10"		"Round 10: I would be okay with that pumpkin if he just paid for his damn food!"
